import React from 'react'


export default function Dashboard(code) {
  return (
    <div className='dashboard-container'>
      <div className='seed-container'>
        <select>
          <option value="genre">Genre</option>
          <option value="artist">Artist</option>
        </select>
      </div>
    </div>
  )
}
